&lt;h1&gt;
	Parking in New York&lt;/h1&gt;
&lt;p&gt;
	New York is one of the busiest and most densely populated cities in the US. &lt;strong&gt;Parking rates in NYC&lt;/strong&gt; are one of the highest in the country. Here are some ideas on how to survive when looking for a place to park in New York.&lt;/p&gt;
&lt;p&gt;
	Commercial &lt;a href="http://en.parkopedia.com/parking/manhattan/"&gt;garages in Manhattan&lt;/a&gt; charge $12-$18 per hour and can go up as high as $55 per 24 hours (SUVs and oversized vehicles are charged additional fees). It&amp;rsquo;s a good idea to look for early bird and overnight specials or coupons for discounted parking!&lt;/p&gt;
&lt;p&gt;
	A good alternative is to park in the suburbs and then take public transport to downtown:&lt;/p&gt;
&lt;ul&gt;
	&lt;li&gt;
		&lt;a href="http://en.parkopedia.com/parking/brooklyn/"&gt;Parking in Brooklyn&lt;/a&gt; starts at $26 for 24 hours&amp;nbsp;&lt;/li&gt;
	&lt;li&gt;
		&lt;a href="http://en.parkopedia.com/parking/bronx/"&gt;Parking in Bronx&lt;/a&gt; ranges approximately at $15 for 24 hours.&lt;/li&gt;
&lt;/ul&gt;
&lt;h2&gt;
	&amp;nbsp;&lt;/h2&gt;
&lt;h2&gt;
	On-street parking&lt;/h2&gt;
&lt;p&gt;
	On-street parking in the Bronx, Brooklyn, Queens and Staten Island is $1 per hour, while on-street meters in Manhattan charge from $1.50 to $6 per hour, depending on the area. Meters take quarters and credit cards.&lt;/p&gt;
&lt;p&gt;
	On-street rates in &lt;a href="http://www.nyc.gov/html/dot/html/motorist/parksmart.shtml"&gt;PARK-Smart areas&lt;/a&gt; will vary depending on the time of day and demand.&lt;/p&gt;
&lt;p&gt;
	On-street signage can be confusing. Check the &lt;a href="http://www.nyc.gov/html/dot/html/motorist/parking-regulations.shtml"&gt;NYC parking regulations&lt;/a&gt;, so that you don&amp;rsquo;t get a pricey ticket.&lt;/p&gt;
&lt;p&gt;
	Check out &lt;a href="http://en.parkopedia.com/mobile-parking-apps/"&gt;our apps&lt;/a&gt; to filter between different amenities and read the &lt;strong&gt;reviews for NYC lots or garages&lt;/strong&gt; to know what to expect, and don&amp;rsquo;t forget to leave us feedback!&lt;/p&gt;
